import './App.css';
import LiveScore from './LiveScore/LiveScore';

function App() {
  return (
    <div className="App">
      <div className='wraper'>
        <h1>Live Football Score</h1>
        <LiveScore />
      </div>
    </div>
  );
}

export default App;
